2.1.3	Произвести сборку и установку Товара по месту нахождения объекта Заказчика, на условиях отдельно заключаемого Договора, если иное не указано в Спецификации (Приложении).
2.1.4	Предоставить по требованию Заказчика копии сертификатов соответствия поставляемого Товара, заверенные печатью Поставщика, а также иную, предусмотренную законодательством РФ документацию. 
2.2. Заказчик обязуется:
2.2.1. Принять Товар в рамках, в сроки и на условиях настоящего Договора по товарным накладным;
2.2.2. Предоставить доступ персоналу Поставщика на объект Заказчика для надлежащего выполнения обязательств по настоящему Договору;
2.3. Заказчик несёт все расходы на Товар и весь риск, которому может подвергаться Товар (в том числе риск случайной гибели или случайного повреждения Товара), с момента исполнения  Поставщиком своей обязанности по Договору.

6.7. В случае обнаружения несоответствия поставленного Товара Спецификации или Товара ненадлежащего качества (включая скрытые дефекты) и составления рекламационного акта, Поставщик возмещает Заказчику ущерб в полном объёме, на условиях согласованных Сторонами, в одной из следующих форм, по выбору Поставщика:
- возмещение стоимости дефектного и/или недопоставленного Товара;
- замена на аналогичный либо равноценный Товар;
- допоставка.
